import React, { useEffect } from 'react';

export default function ConsentDeclined() {
  const prolificCode = 'CULT-CONSENT-DECLINED-2024';

  // Prevent refresh/back button
  useEffect(() => {
    const handleBeforeUnload = (e: BeforeUnloadEvent) => {
      e.preventDefault();
      e.returnValue = 'Please do not refresh this page. Use the Prolific code to return the survey.';
      return 'Please do not refresh this page. Use the Prolific code to return the survey.';
    };

    const handlePopState = (e: PopStateEvent) => {
      e.preventDefault();
      window.history.pushState(null, '', window.location.href);
    };

    // Prevent back button
    window.history.pushState(null, '', window.location.href);
    
    window.addEventListener('beforeunload', handleBeforeUnload);
    window.addEventListener('popstate', handlePopState);

    return () => {
      window.removeEventListener('beforeunload', handleBeforeUnload);
      window.removeEventListener('popstate', handlePopState);
    };
  }, []);

  const copyToClipboard = () => {
    navigator.clipboard.writeText(prolificCode);
    alert('Prolific code copied to clipboard!');
  };

  return (
    <div 
      className="min-h-screen flex items-center justify-center p-4"
      style={{ 
        background: `linear-gradient(135deg, var(--bg-primary) 0%, var(--color-cream) 50%, var(--bg-secondary) 100%)` 
      }}
    >
      <div 
        className="max-w-3xl mx-auto rounded-3xl shadow-2xl p-8 md:p-12 animate-fade-in"
        style={{ backgroundColor: 'var(--bg-card)' }}
      >
        {/* Header */}
        <div className="text-center mb-12">
          <div className="inline-flex items-center justify-center w-24 h-24 rounded-full mb-6"
               style={{ backgroundColor: 'var(--color-blue-gray)' }}>
            <span className="text-4xl">ðŸš«</span>
          </div>
          
          <h1 
            className="text-4xl md:text-5xl font-bold mb-4"
            style={{ color: 'var(--text-primary)' }}
          >
            Thank You
          </h1>
          
          <p 
            className="text-xl mb-6"
            style={{ color: 'var(--text-secondary)' }}
          >
            Consent Declined
          </p>
        </div>

        {/* Prolific Code - Neutral Blue */}
        <div 
          className="border-2 rounded-2xl p-8 mb-8 text-center"
          style={{ 
            backgroundColor: 'var(--color-blue-gray)', // Neutral blue background
            borderColor: 'var(--color-olive)'
          }}
        >
          <h2 
            className="text-2xl font-bold mb-4"
            style={{ color: 'white' }}
          >
            Please Return This Survey on Prolific
          </h2>
          <p 
            className="text-lg mb-4"
            style={{ color: 'white' }}
          >
            Use this code to return the survey:
          </p>
          <div 
            className="bg-white border-2 border-dashed rounded-lg p-4 mb-4 cursor-pointer hover:bg-gray-50"
            style={{ borderColor: 'var(--color-olive)' }}
            onClick={copyToClipboard}
          >
            <span className="text-2xl font-mono font-bold text-gray-800">
              {prolificCode}
            </span>
          </div>
          <button
            onClick={copyToClipboard}
            className="px-6 py-2 bg-white font-semibold rounded-lg hover:bg-gray-100 transition-colors"
            style={{ color: 'var(--color-olive)' }}
          >
            ðŸ“‹ Copy Code
          </button>
        </div>

        {/* Explanation */}
        <div 
          className="border rounded-2xl p-6 mb-8"
          style={{ 
            backgroundColor: 'var(--color-cream)',
            borderColor: 'var(--border-light)'
          }}
        >
          <h3 
            className="text-lg font-bold mb-3"
            style={{ color: 'var(--text-primary)' }}
          >
            Your decision is respected
          </h3>
          <p 
            className="mb-4"
            style={{ color: 'var(--text-secondary)' }}
          >
            You have chosen not to participate in this research study. This is completely acceptable and your decision to decline participation is fully respected.
          </p>
          <p 
            className="text-sm"
            style={{ color: 'var(--text-muted)' }}
          >
            Please use the code above to return this survey on Prolific. No further action is required on your part.
          </p>
        </div>

        {/* Additional Information */}
        <div 
          className="border rounded-2xl p-6 mb-8"
          style={{ 
            backgroundColor: 'var(--color-blue-gray-changed)',
            borderColor: 'var(--border-light)'
          }}
        >
          <h3 
            className="text-lg font-bold mb-3"
            style={{ color: 'var(--text-primary)' }}
          >
            What happens next?
          </h3>
          <ul 
            className="list-disc list-inside space-y-2"
            style={{ color: 'var(--text-secondary)' }}
          >
            <li>No data has been collected from you</li>
            <li>You will not be contacted again about this study</li>
            <li>Simply return the survey on Prolific using the code above</li>
            <li>You can now safely close this browser tab</li>
          </ul>
        </div>

        {/* Final Message */}
        <div className="text-center">
          <p 
            className="text-lg font-medium"
            style={{ color: 'var(--text-secondary)' }}
          >
            Thank you for considering our research study.
          </p>
          <p 
            className="text-sm mt-2"
            style={{ color: 'var(--text-muted)' }}
          >
            Don't forget to use the Prolific code above to return the survey.
          </p>
        </div>
      </div>
    </div>
  );
}
